import React from 'react';
import { Link } from 'react-router-dom';
import styled from '@emotion/styled';


function NavBar({logout}){
    const Nav = styled.nav`
        position: absolute;
        top: 0px;
        left: 0px;
        width: 100%;
        background-color: #212a31;
        height: 100px;
        padding: 10px;
    `;

    const NavButton = styled.button`
        width: 120px;
        height: 60px;
        background-color: #212a31;
        color: white;
        font-family: "Roboto Condensed", sans-serif;
        font-size: 16px;
        outline: none;
        border: solid 2px white;
        border-radius: 0.3rem;
        &:hover {
            background-color: white;
            color: #212a31;
        }
    `;

    const logoStyle = {
        float: 'left', 
        marginLeft: '20px', 
        color: 'white', 
        fontSize: '20px',
        textShadow: '1px 1px 1px #000'
    };

    return (
        <Nav>
            <div className="title" style={logoStyle}>Apple Stuff!</div>
            <NavButton style={{float: 'right', marginRight: '40px', marginTop: '10px'}} onClick={logout}>Logout</NavButton>
        </Nav>
    )
}

export default NavBar;
